commitmsg:
Client now capable of signing in and storing unencrypted payloads

E.g.:

    var client = new GombotClient('https://gombot.org/api');
    client.account({email: 'foo@bar.com', pass: 'baz'}, function (err, r) {
      client.storePayload({payload: 'foo'});
    });

Later on in browser B:

    var client = new GombotClient('https://gombot.org/api');
    client.signIn({email: 'foo@bar.com', pass: 'baz'}, function (err, r) {
      client.getPayload({}, function (err, r) {
        console.log(r.payload);
      });
    });
